"""#Exercício 1 de operadores relacionais e booleanos

O usuário deve digitar os seguinte inputs numéricos sobre coleta de indivíduos e espécies:

1- Espécies coletadas na seção A

2- Indivíduos coletados na seção A

3 - Obter a média de indivíduos por espécie na seção A

4- Espécies coletadas na seção B

5- Indivíduos coletados na seção B

6 - Obter a média de indivíduos por espécie na seção B

Posteriormente, deve realizar as seguintes comparações:

![image.png](data:image/png;base64,)

Entradas da seção A
"""

especiesA = int(input('Numero de espécies coletadas na seção A: '))

individuosA = int(input('Número de indivíduos coletados na seção A'))

mediaA = individuosA/especiesA

mediaA

especiesB = int(input('Numero de espécies coletadas na seção B: '))

individuosB = int(input('Número de indivíduos coletados na seção B'))

mediaB = individuosB/especiesB

mediaB

"""Entradas da seção B

Testando as comparações
"""

#Comparação a
individuosA >= individuosB

#Comparação b
individuosA != individuosB

#Comparação c
(individuosA > individuosB) or (mediaA > mediaB)

#Comparação d
(individuosA != individuosB) and (mediaA != mediaB)